import { useParams } from "react-router-dom";


const AccountConfirmPage = () =>{

    const {uid, token} = useParams();

    const confirmEmail = async (uid:string, token:string) => {
        try{
            const response = await fetch('http://localhost:8000/api/confirm_email', {
                method: 'POST',
                headers: {'Content-Type': 'application/json'},
                body: JSON.stringify({
                    uid,
                    token
                })
            });
            if(response.ok){
                console.log('konto aktywowane')
            }
            else{
                console.log('blad aktywacji konta');
            }

        } catch (error){
            console.log('request error');
        }

    }

    return(
        <div>
            Twoje konto zosta≈Ço zaaktywowane!
        </div>
    );
}

